export default (function(a,b,c,d,e,f,g,h,i){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:d,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:b,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:b,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:b,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:d,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}},{id:2784,attributes:{type:b,item_lang:{data:{id:3451,attributes:{title:"Renfield",slug:"renfield"}}}}},{id:2788,attributes:{type:b,item_lang:{data:{id:3455,attributes:{title:"The Killer",slug:"the-killer"}}}}},{id:2790,attributes:{type:b,item_lang:{data:{id:3457,attributes:{title:"The Color Purple",slug:"the-color-purple"}}}}},{id:2798,attributes:{type:d,item_lang:{data:{id:3465,attributes:{title:"Silo",slug:"silo"}}}}},{id:2802,attributes:{type:d,item_lang:{data:{id:3469,attributes:{title:"The Night Agent",slug:"the-night-agent"}}}}}],meta:{pagination:{page:f,pageSize:25,pageCount:f,total:10}}},rXXuaXe8fB:{data:{id:2002,attributes:{imdbId:"tt12880552",poster:g,type:b,ratings:[],item_lang:{data:{id:2665,attributes:{title:h,plot:g,slug:"outsider"}}},books:{data:[{id:9984,attributes:{title:i,description:"Now an HBO limited series starring Ben Mendelsohn!​ Evil has many faces…maybe even yours in this #1 New York Times bestseller from master storyteller Stephen King. An eleven-year-old boy’s violated corpse is discovered in a town park. Eyewitnesses and fingerprints point unmistakably to one of Flint City’s most popular citizens—Terry Maitland, Little League coach, English teacher, husband, and father of two girls. Detective Ralph Anderson, whose son Maitland once coached, orders a quick and very public arrest. Maitland has an alibi, but Anderson and the district attorney soon have DNA evidence to go with the fingerprints and witnesses. Their case seems ironclad. As the investigation expands and horrifying details begin to emerge, King’s story kicks into high gear, generating strong tension and almost unbearable suspense. Terry Maitland seems like a nice guy, but is he wearing another face? When the answer comes, it will shock you as only Stephen King can.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=yK_iyQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[c],firstBook:true,published:"2018-05-22",publisher:"Scribner",subtitle:"A Novel"}},{id:9985,attributes:{title:i,description:"Soon to be an HBO limited series starring Ben Mendelsohn. 'If you read only one thriller this summer, make it this one' Daily Mail A horrifying crime. Water-tight evidence points to a single suspect. Except he was seventy miles away, with an iron-clad alibi. Detective Anderson sets out to investigate the impossible: how can the suspect have been both at the scene of the crime and in another town?",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=SYWGvQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[c],firstBook:e,published:"2019-05-02",publisher:"Hodder Paperbacks",subtitle:a}},{id:9986,attributes:{title:h,description:"W parku miejskim znalezione zostaje zmasakrowane ciało jedenastoletniego chłopca. Naoczni świadkowie i odciski palców nie pozostawiają wątpliwości: sprawcą zbrodni jest jeden z najbardziej lubianych obywateli Flint City. To Terry Maitland, trener drużyn młodzieżowych, nauczyciel angielskiego, mąż i ojciec dwóch córek. Detektyw Ralph Anderson, którego syna Maitland kiedyś trenował, nakazuje przeprowadzić natychmiastowe aresztowanie w świetle jupiterów. Maitland ma wprawdzie alibi, ale Anderson i prokurator okręgowy wkrótce zdobywają kolejny niezbity dowód: ślady DNA. Sprawa wydaje się oczywista.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=GolIuAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[c],firstBook:e,published:"2018-01-01",publisher:a,subtitle:a}},{id:9987,attributes:{title:"Der Outsider",description:a,thumbnail:a,authors:[c],firstBook:e,published:"2018-08-27",publisher:a,subtitle:a}},{id:9988,attributes:{title:"If It Bleeds",description:"A collection of four uniquely wonderful long stories, including a stand-alone sequel to the No. 1 bestseller THE OUTSIDER. News people have a saying: 'If it bleeds, it leads'. And a bomb at Albert Macready Middle School is guaranteed to lead any bulletin. Holly Gibney of the Finders Keepers detective agency is working on the case of a missing dog - and on her own need to be more assertive - when she sees the footage on TV. But when she tunes in again, to the late-night report, she realises there is something not quite right about the correspondent who was first on the scene. So begins 'If It Bleeds', a stand-alone sequel to the No. 1 bestselling THE OUTSIDER featuring the incomparable Holly on her first solo case - and also the riveting title story in Stephen King's brilliant new collection. Dancing alongside are three more wonderful long stories from this 'formidably versatile author' (The Sunday Times) - 'Mr Harrigan's Phone', 'The Life of Chuck' and 'Rat'. All four display the richness of King's storytelling with grace, humour, horror and breathtaking suspense. A fascinating Author's Note gives us a wonderful insight into the origin of each story and the writer's unparalleled imagination",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=PutSygEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[c],firstBook:e,published:"2020-05-05",publisher:a,subtitle:a}}]}}},meta:{}}},prerenderedAt:1688531316879}}("","movie","Stephen King","series",null,1,"N\u002FA","Outsider","The Outsider"))